<h5>Подготовительные работы</h5>
<p>От того, насколько грамотно и качественно выполнен этап подготовительных работ зависит, то как будет выглядеть брусчатка в конце работы и продолжительность срока ее эксплуатации. Самым оптимальным считается следующий порядок выполнения работ на этом этапе:</p>
<ul>
<li>Удалить верхний слой грунта (плодородный слой), если расположение грунтовых вод достаточной высоко, то произвести частичную засыпку смесью песка и щебня с промежуточным уплотнением.</li>
<li>Уложить геотекстиль с небольшим выпуском материала.</li>
<li>Насыпать десять, а лучше пятнадцать сантиметров гравия.</li>
<li>Создать подушку из песка толщиной не меньше пяти сантиметров, но и не больше пятнадцати. Она увлажняется и трамбуется. При этом на один кубический метр должно расходоваться не меньше десяти литров воды.</li>
<li>Уложить смесь, состоящую из цемента и песка (от 2 до 4 см).</li>
</ul>
<p>В соответствии с предназначением поверхности из брусчатки и вероятных нагрузок, которые могут быть оказаны на нее, состав компонентов может несколько меняться.</p>
<h5>Каким образом происходит укладка брусчатки и другой тротуарной плитки</h5>
<p>Специалисты, для выполнения этой работы применяются два способа: при одном в качестве основания используется бетон, а при другом — щебень.</p>
<h5>Кладем тротуарную плитку на щебень</h5>
<p>В этом варианте используется сухая смесь, в которой на одну часть цемента приходится шесть частей песка. Она высыпается на предварительно подготовленное основание, для которого используется щебень, насыпанный слоем, чья толщина может колебаться от ста до ста пятидесяти миллиметров. Для изготовления бордюров рекомендуется использование раствор на основе цемента марки не меньше М-100 или приобретать готовый бордюрный камень. С целью придания покрытию дополнительной жесткости, укладывается специальная армирующая сетка.</p>
<p>Элементы тротуарной плитки укладываются так, чтобы между ними присутствовали швы. Их предназначением является компенсация возможных подвижек грунтов, связанных с сезонными колебаниями температуры.</p>
<p>Технология укладки состоит из следующих этапов:</p>
<ul>
<li>Вначале производится подготовка площадки. О том, как это должно быть сделано можно посмотреть выше по тексту.</li>
<li>Создается подстилка. На первый слой основания оказывается довольно большая нагрузка, поэтому для его создания лучше всего воспользоваться смесь щебня с гравием. При этом необходимо соблюдение минимального наклона к краям от середины. Рекомендованный угол — от полутора до двух градусов.</li>
<li>Подготовленная площадка ограждается с помощью бетонного бордюра. Чтобы его изготовить, в грунте делается небольшая траншея, дно которой засыпается песком. Глубина этого углубления должна быть рассчитана так, чтобы высота изготовленного бордюра не была выше лицевой части плитки, а лучше, если он будет несколько ниже. Таким образом, обеспечивается сток воды после выпадения осадков. Затем между готовыми бордюрами следует натянуть шнур, в качестве ориентира при укладке элементов брусчатки.</li>
<li>Подготовленная площадка засыпается следующим слоем толщиной порядка 30 мм. Для него используется крупнозернистый песок, имеющий фракцию не больше пяти миллиметров.</li>
<li>Не допускается, чтобы толщина всего несущего слоя была меньше ста миллиметров. Для уплотнения песка используется трамбовка. Чтобы ее изготовить можно взять метровый обрезок бруса сечением 20 на 20 мм и прикрепить к нему поперечную палку.</li>
<li>Начинать кладку брусчатки следует от бордюра. При укладке первого ряда в качестве ориентира пользуются натянутой бечевкой. Межплиточные швы необходимо заполнять с помощью песка, чтобы предотвратить сдвигание элементов.</li>
</ul>
<h5>Использование бетона в качестве основания для тротуарной плитки</h5>
<p>Этот метод укладки используется в том случае, если планируется передвижение по брусчатке автомобилей. Кроме того, им пользуются, если укладка производится на очень слабые или заболоченные почвы. В этих случаях не обойтись без подготовки надежного бетонного основания. А потому к вышеназванным операциям добавляются новые пункты:</p>
<ul>
<li>Из досок (как обрезных, так и не обрезных) или фанерных листов изготавливается опалубка. Ее стенки закрепляются посредством кольев, которые вбиваются в грунт. Расстояние между ними не должно превышать одного метра.</li>
<li>Внутрь опалубки засыпается сто миллиметровый слой щебня, имеющего средний размер. Его хорошо утрамбовывают.</li>
<li>Заливается порядка тридцати сантиметров бетона, на предварительно уложенную армирующую сетку. Готовую площадку рекомендуется закрыть целлофановой пленкой во избежание образования трещин в процессе высыхания.</li>
<li>Для полного затвердевания бетона понадобится не менее 28 дней. По истечении этого срока можно производить укладку брусчатки. Для заполнения швов должен использоваться цемент-песочный раствор. Чтобы избежать его вымывания, уложенную плитку промывают, используя лейку.</li>
</ul>
<h5>Особенности укладки вибропрессованной плитки</h5>
<p>Рисунок для укладки брусчатки или другой тротуарной плитки выбирается хозяином. Очень часто они, не мудрствуя лукаво, используют рисунок под названием «елочка». Но возможны и любые другие варианты, благо разнообразие форм и цветовых гамм позволяют дать волю фантазии. При использовании разноцветной брусчатки в качестве затирки желательно воспользоваться специальной фугой, в составе которой помимо цемента также присутствуют и колерные добавки. Выравнивается уложенная поверхность посредством киянки, ударная часть которой изготовлена из резины.</p>
<p>Рекомендуется на 1 м делать уклон от 5 до 15 мм. Новичку справиться с идеально ровной укладкой брусчатки — задача практически невыполнимая. А потому незначительный уклон приведет к образованию на дорожке луж.</p>
<p>Усадка брусчатки на подкладку происходит благодаря легкому постукиванию резинового молотка. Для каждого ряда обязательна проверка уровнем, под который подгоняются все элементы. При использовании сухой смеси можно ограничиться заглублением кирпичика на один сантиметр. А если используется влажный вариант, то необходимо погружать его на глубину не менее 2-х см. Для облегчения процесса укладки можно уложить по краям профилированные трубы и натянуть между ними шнур.</p>
<p>Уложенной брусчатке дают время устояться, после чего на нее высыпается сухая песочно-цементная смесь, которая выметается таким образом, чтобы произошло заполнение всех швов между отдельными элементами брусчатки. Однако нельзя допускать, чтобы смесь оставалась на поверхности дорожки, иначе она впоследствии очень сложно удаляется.</p>
<p>Элементарное следование предложенной нами инструкции, если присутствуют желание и возможности, позволит практически любому выложить брусчатку на собственном участке своими руками.</p>',
